import React from 'react';
import './LoginForm.css';


const LoginForm = () => {
  return (
    <div className='container'>
      <div className='wrapper'>
        <div className='img_cont'>
          <img src="https://kongu.ac.in/facilities/images/bus.JPG" alt="Busimg" >
          </img>
          
        </div>
      </div>
      
    </div>
  )
}

export default LoginForm
